import React, { useState, useEffect } from "react";
import "./MatchingResultPage.css";

const MatchingResultPage = () => {
  const [userProfiles, setUserProfiles] = useState([]);

  useEffect(() => {
    // 백엔드에서 데이터를 가져오는 비동기 함수를 호출합니다.
    // 아래 예시에서는 대체 텍스트를 사용하겠습니다.

    // 백엔드에서 가져온 데이터를 setUserProfiles 함수를 통해 설정합니다.
    const fetchData = async () => {
      // 여기에서 데이터를 가져와서 setUserProfiles로 설정해야 합니다.
      const data = await fetchUserDataFromBackend(); // 백엔드에서 데이터 가져오기
      setUserProfiles(data);
    };

    fetchData();
  }, []);

  // 대체 텍스트를 사용한 예시 데이터
  const fetchUserDataFromBackend = async () => {
    return [
      {
        id: 1,
        name: "유저1",
        gender: "남성",
        age: 25,
        exerciseType: "조깅",
        timeSlot: "아침",
        daysOfWeek: "월, 수, 금",
        profileImage: "/user1-profile.jpg",
      },
      {
        id: 2,
        name: "유저2",
        gender: "여성",
        age: 30,
        exerciseType: "요가",
        timeSlot: "점심",
        daysOfWeek: "화, 목, 토",
        profileImage: "/user2-profile.jpg",
      },
      // 추가적인 유저 데이터를 여기에 추가
    ];
  };

  return (
    <div className="matchingresultpage">
      <div className="div8">운동뭉치</div>
      <div className="div9">메이트 매칭</div>
      <img
        className="matchingresultpage-child"
        alt=""
        src="/rectangle-1@2x.png"
      />
      <div className="div10">
        <p className="p">{`운동뭉치에서 여러분에게 딱 맞는 `}</p>
        <p className="p">운동 메이트를 찾아보세요!</p>
      </div>
      <img className="matchingresultpage-item" alt="" src="/rectangle-4.svg" />
      <b className="b2">빠르고 정확한 매칭을 간단하게</b>
      <div className="div11">어렵지 않게 나와 가장 잘 맞는 메이트 찾기</div>
      <div className="div12">1/3</div>
      <div className="userid">USERID님, 환영합니다!</div>
      <div className="div13">매칭결과</div>
      <div className="div14">운동 메이트 매칭 결과를 확인하세요.</div>

      {/* 유저 프로필 부분 */}
      <div className="user-profiles">
        {userProfiles.map((user) => (
          <div key={user.id} className="user-profile">
            <img className="profile-image" src={user.profileImage} alt={user.name} />
            <div className="profile-info">
              <p>이름: {user.name}</p>
              <p>성별: {user.gender}</p>
              <p>나이: {user.age}세</p>
              <p>운동 종류: {user.exerciseType}</p>
              <p>운동 시간대: {user.timeSlot}</p>
              <p>운동 요일: {user.daysOfWeek}</p>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default MatchingResultPage;
